        mydata : []
    }
    componentDidMount(){
        axios.get("http://localhost:5000/reactload").then(res=>{
            console.log(res)
            this.setState({mydata : res.data})
    })
    }
    render(){

        const mydata222 = this.state.mydata.map(hlists=>{
            return <TeacherBody name1={hlists.username}/>
            })
           
        return(
            <div>
                 
                        <div className="myteacher">This is main teacher page..</div>
                        <TeacherHeader/>
                    {mydata222}
                        </div>
        )
    }
}

export default Teacher;
